import React from 'react'
import logo from './banner.jpg';
import Jumbotron from 'react-bootstrap/jumbotron';
import Button from 'react-bootstrap/Button';
class Main extends React.Component {
  render() {
    return (
      <div>
      <img className="img-responsive" src={logo} alt="logo"/>
      <Jumbotron style = {{ width: '100rem', margin: '0 auto', float: 'none', }}>
  <h1 >Welcome to Reality Ministries Rideshare!</h1>
  <p>
    This web application was created to allow volunteers the ability to rideshare! Please select an option from the dropdown menu to proceed.
  </p>

  </Jumbotron>
      </div>
    )
  }
}
export default Main
